    onSubmit() {
        this.feedback.reason = this.feedback.reason.trim();
        if (this.feedback.reason) {
            let params = {
                "url": 'unsubscribe-newsletter',
                "email_address": this.email,
                "status_reason": this.feedback.reason
            };
            this.http.post(params).subscribe((res) => {
                if (res.error) {
                    this.toastr.error(res.message, 'Error', { closeButton: true });
                }
                else {
                    this.toastr.success(res.message, 'Success', { closeButton: true });
                    this.feedback.reason = "";
                    this.textMessage = "";
                    this.isUnsubscribe = true;
                }
            });
        }
        else {
            this.feedback.reason = this.feedback.reason.trim();
        }
    }
