        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](43, " We also follow the Bloom's Taxonomy Framework to facilitate our medical e-Learning video lectures to help our students in achieving higher depth of learning along with an understanding of the subject matter. Moreover, it allows generation of an Assessment Report that gives an accurate feedback on students\u2019 progress and how much they have achieved their learning goals. Thus, our video lectures ensure that instruction and assessment are in sync with the learning goals, both for the teachers as well as well as for the students. This helps in a harmonious delivery of Course and better results. ");
