        _angular_core__WEBPACK_IMPORTED_MODULE_0__["ɵɵtext"](46, " Further, we have integrated Adaptive Learning to Richard Mayer's Principles for Multimedia Learning and e-Learning and the Science of Instruction. By perfectly integrating high quality 2D and 3D animations and high-resolution medical illustrations in our Medical e-Learning Video Lectures, we have reaped the benefits of Richard Mayer\u2019s Principles. ");
